import React from "react";
import Pageheader from "./Components/Header/Header";
import "./Demo.css";
const Demo = () => {
  return (
    <div>
      <Pageheader />

      <main>
        <section className="sectionAbout">{/* About */}</section>
        <section className="sectionOurServices">{/* Ours Services */}</section>
        <section className="sectionTeam">{/* Team */}</section>
      </main>
    </div>
  );
};

export default Demo;
